B.Hi=A.a(s(["Je nach Typ (n oder p) sind freie Elektronen oder L\xf6cher in einem Halbleiter vorhanden.","Legt man eine Spannung U an die Struktur, so bewirkt dies ein elektrisches Feld E im Halbleiter.","Unter Einfluss des elektrisches Feldes E bewegen sich die freien Ladungstr\xe4ger in dem Halbleiter, was zu einem elektrischen Strom I f\xfchrt.","Je gr\xf6\xdfer die Spannung ist, desto so gr\xf6\xdfer ist das elektrische Feld und damit die Geschwindigkeit der Ladungstr\xe4ger, was eine Zunahme des Stromes bedeutet. Der Zusammenhang zwischen elektrischem Feld und der Ladungstr\xe4gergeschwindigkeit ist die so genannte Beweglichkeit."]),t.s)
